import com.geeks.nurkyz_chomoeva_hw3_7.databinding.FragmentContactsBinding

class ContactsFragment : Fragment() {

    lateinit var viewBinding: FragmentContactsBinding
    var contacts = ArrayList<ContactModel>()
    lateinit var contactAdapter: ContactAdapter

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        loadData()
    }
    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View {
        viewBinding = FragmentContactsBinding.inflate(layoutInflater)
        return viewBinding.root
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)
        contactAdapter = ContactAdapter(contacts) { position ->
            val contactsModel = contacts[position]
            val bundle = Bundle().apply {
                putString("contactName", contactsModel.name)
                putString("contactNumber", contactsModel.number)
                putString("contactPhoto", contactsModel.image)

            }

            val fragment = ChatFragment()
            fragment.arguments = bundle
            findNavController().navigate(R.id.action_contactsFragment_to_chatFragment,bundle)

        }
        viewBinding.apply {
            rvContacts.adapter = contactAdapter
        }
    }


    private fun loadData() {
        contacts.add(ContactModel("Groot", "+996500555005", "data:image/jpeg;base64,"))

        contacts.add(ContactModel("Iron Man", "+996999002234", "data:image/jpeg;base64,"))

